import React from 'react';
import {ContentLayout} from "@shared/ui";
import Header from "@widgets/header";
import { Outlet } from 'react-router-dom';

export const MainLayout = () => {
    return (
        <ContentLayout row noAnimation>
            <Outlet />

            <Header />
        </ContentLayout>
    );
};
